#include <stdlib.h>
#include <stdio.h>
#include <string.h>
#include <stdbool.h>

/**
 * You need to create a program that retrieves all the uppercase letters from a specific text input.
 * However, if there are no uppercase letters found, the program should print the constant value None.
 * Players must reverse engineer the code to find the original uppercase letters or determine that there are none.
 * 
 * Entr√©e:
 * string
 * 
 * Sortie:
 * string
 * 
 * Contraintes:
 * 
 * Exemple:
 * Entr√©e:
 * abcdABCD
 * Sortie:
 * ABCD
 */

int main()
{
    char s[257];
    scanf("%[^\n]", s);
    int x=0;
    bool f=0;
    char tab[strlen(s)];
    int cpt=0;
    for (int i=0; i<strlen(s); i++) {
        if (s[i] >= 'A' && s[i] <= 'Z' ) {
            tab[cpt++] = s[i];
            f=true;
        }
    }
    if (!f) {
        printf("%s\n", "None");
    } else {
        printf("%s\n", tab);
    }

    return 0;
}

#include <stdlib.h>
#include <stdio.h>
#include <string.h>
#include <stdbool.h>

/**
 * Le programme :
 * Votre programme doit calculer la valeur d'une fonction affine aux points donn√©s.
 *
 * Une fonction affine est une fonction de la forme f(x) = a * x + b avec a et b, deux constantes.
 * On vous donne a, b et un ensemble de N valeurs de x. Vous devez calculer la valeur de f(x) pour les N valeurs de x.
 */

int main()
{
    int a;
    int b;
    scanf("%d%d", &a, &b);
    int n;
    scanf("%d", &n);
    for (int i = 0; i < n; i++) {
        int x;
        scanf("%d", &x);
        printf("%d\n", a*x+b);
    }
    return 0;
}

