double power(double x, int n) {
	//double y = pow(x, n);
	if (n == 0) 
		return 1;
	
	if (n < 0) {
		n = -n;
		x = 1.0 / x;
	}

	double y = 1;
	while (n > 0) {
		n--;
		y *= x;
	}	
	return y;
}

