}

void multy_table() {
	// x\y | 2 3 4 ....
	// --------------------------
	//  2  | 4  6  8
	//  3  | 6  9 12
	//  4  | 8 12 16
	//    ...
	int x = 1, y = 1;

	while (x < 10){
		y = 1;
		while (y < 10) {
			if(y * x == 1)
				cout << "x\\y" << "\t";
			else
				cout << y * x << "\t";	
			++y;
		}
		x++;
		cout << endl;
	}
}

