    scanf("%d",&n);
    
    int mat[n][n];
    for(int i = 0; i < n; i++) {
        for(int j = 0; j < n; j++) {
            scanf("%d", &mat[i][j]);
        }
    }
    
    for(int i = 0; i < n; i++) {
        printf("%d\n", mat[i][n - 1 - i]);
