#include <iostream>
#include <vector>

using namespace std;

class Bazowa
{
protected:
	int wartosc;
public:
	Bazowa(int v) : wartosc(v) {}
	virtual void wypisz_stan() const { cout << "Obiekt klasy Bazowa ma wartosc " << wartosc << endl; }		// metoda wirtualna
};

class Pochodna : public Bazowa		// klasa Pochodna dziedziczy od klasy Bazowej
{
private:
	int druga_wartosc;
public:
	Pochodna(int v1, int v2) : Bazowa(v1), druga_wartosc(v2) {}		// przy wywo≈Çaniu konstruktora klasy Pochodna korzystamy z konstruktora klasy Bazowa
	void wypisz_stan() const { cout << "Obiekt klasy Pochodna ma wartosci " << wartosc << " i " << druga_wartosc << endl; }
};

int main()
{
	vector<Bazowa*> obiekty{};
	obiekty.push_back(new Bazowa{ 10 });
	obiekty.push_back(new Pochodna{ 3, 8 });

	unsigned n = obiekty.size();
	for (unsigned i = 0; i < n; ++i)
		obiekty[i]->wypisz_stan();		// wywo≈Çanie polimorficzne (w zale≈ºno≈õci od tego z obiektem kt√≥rej klasy mamy do czynienia, wywo≈Çanie jest inne

	for (unsigned i = 0; i < n; ++i)
		delete obiekty[i];

	return 0;
}

